import "./style.css"
const GifyModel= (props)=>{
 console.log(props.data);
    return(
        <div className= "gify_container">
            <input className="gify_inp" onClick={(e)=>{
              props.fn(e.value);
            }}/>
            <div>
                {
                  props.data.forEach((el,key)=>{
                  return(<img src="https://giphy.com/gifs/cat-funny-WXB88TeARFVvi" alt="gify"/>)
                })
                }
                {/* <img src="https://giphy.com/gifs/cat-funny-WXB88TeARFVvi" alt="gify"/> */}
            </div>
        </div>
    )
}

export default GifyModel;
